import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Register from './pages/Register';
import List from './pages/List';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Register</Link>
            </li>
            <li>
              <Link to="/list">List</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/list">
            <List />
          </Route>
          <Route path="/">
            <Register />
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
